const about = ()=>{
    return(<div>
     <AppBar position="fixed" color="primary" elevation="0" className="a">
        <Toolbar>
          <IconButton edge="start"  color="inherit" aria-label="menu">
            
          </IconButton>
          <Typography variant="h6" >
            News
          </Typography>
          <Button color="inherit">Login</Button>
        </Toolbar>
      </AppBar>
        
        <style jsx>{`
          .a{
            margin-bottom: 0;
            background-color: #fff;        
          }
          .bss{
            padding: 0;
          }
        `}</style>
    </div>)
}

export default about;
